con:eventHandlers.con:script:
if (submit.response == null)
{   
	log.info "REST Login token request is NULL"
	return
}

// Get the response header
def headers = submit.response.responseHeaders

// Get the token from the response header stored in the property X-IHG-UserContext
def tempString = headers.get("X-IHG-UserContext").toString()

// Clean it up ('\\' needed to close character for Regexp)
tempString = tempString.replaceAll("\\[IAM ", "")
tempString = tempString.replaceAll("]", "")

// Generate the new token using ticketUtil.jar found in the project directory
def proc = ["java", "-jar", context.expand('${projectDir}') + "\\ticketUtil.jar", tempString, "61140"].execute()
proc.waitFor()
def authToken = proc.in.text

// Re-insert the [IAM ... ] part of the token again
authToken = "IAM " + authToken
log.info authToken

// Set the project property AuthToken to the value of authToken so it can be used by all scripts
context.testCase.testSuite.project.setPropertyValue("AuthToken", authToken.trim())

// Load custom endpoint to the project property CustomEndpoint
// so that we can use dynamic endpoints from config files
String endpoint = new File(context.expand('${projectDir}') + "\\endpoint.txt").text
context.testCase.testSuite.project.setPropertyValue("CustomEndpoint", endpoint.trim())

if(context.testCase.name != "GenerateToken")
{
	log.info "Running GenerateToken"
	def slaveTestCase = context.testCase.testSuite.project.getTestSuiteByName("GenerateToken").getTestCaseByName("GenerateToken")
	slaveTestCase.run(new com.eviware.soapui.support.types.StringToObjectMap(), false)
}

if(context.testCase.name != "GenerateToken")
{
	log.info context.getCurrentStep().getLabel()
	String endpoint = context.testCase.testSuite.project.getPropertyValue("CustomEndpoint")
	context.testCase.getTestStepByName(context.getCurrentStep().getLabel()).setPropertyValue("Endpoint", endpoint)
}
